  `business_name` varchar(50) DEFAULT NULL COMMENT '门店名称,默认是0',
  `parentId` int(11) DEFAULT '0' COMMENT '主副关系',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=92 DEFAULT CHARSET=utf8;

