/*Table structure for table `material` */

DROP TABLE IF EXISTS `material`;

CREATE TABLE `material` (
  `sid` int(11) NOT NULL AUTO_INCREMENT,
  `store_code` varchar(20) DEFAULT NULL COMMENT '门店编码',
  `material_type` varchar(10) DEFAULT NULL COMMENT '素材类型',
  `media_id` varchar(100) DEFAULT NULL COMMENT '素材mid',
  `image_name` varchar(100) DEFAULT NULL COMMENT '图片名称',
  `title` varchar(100) DEFAULT NULL COMMENT '图文消息的标题',
  `thumb_media_id` varchar(100) DEFAULT NULL COMMENT '图文消息的封面图片素材id（必须是永久mediaID）',
  `thumb_url` varchar(255) DEFAULT NULL COMMENT '封面图片地址',
  `show_cover_pic` int(11) DEFAULT '1' COMMENT '是否显示封面默认1，0为false，即不显示，1为true，即显示',
  `author` varchar(50) DEFAULT NULL COMMENT '作者',
  `digest` varchar(255) DEFAULT NULL COMMENT '图文消息的摘要，仅有单图文消息才有摘要，多图文此处为空',
  `content` longtext COMMENT '图文消息的具体内容，支持HTML标签，必须少于2万字符，小于1M，且此处会去除JS',
  `pic_url` varchar(255) DEFAULT NULL COMMENT '图文页的URL，或者，当获取的列表是图片素材列表时，该字段是图片的URL',
  `content_soure_url` varchar(255) DEFAULT NULL COMMENT '图文消息的原文地址，即点击“阅读原文”后的URL',
  `local_url` varchar(255) DEFAULT NULL COMMENT '图片地址or图文封面图片地址',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后一次修改时间',
  `local_content` longtext COMMENT '本地图文内容',
  PRIMARY KEY (`sid`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8;

