/*Table structure for table `t_category_props_dict` */

DROP TABLE IF EXISTS `t_category_props_dict`;

CREATE TABLE `t_category_props_dict` (
  `sid` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '店铺ID',
  `shop_id` bigint(20) DEFAULT NULL,
  `props_sid` bigint(20) DEFAULT NULL COMMENT '属性编码',
  `props_name` varchar(100) DEFAULT NULL COMMENT '属性名',
