/*Table structure for table `template_message_log` */

DROP TABLE IF EXISTS `template_message_log`;

CREATE TABLE `template_message_log` (
  `sid` bigint(20) NOT NULL AUTO_INCREMENT,
  `message_content` varchar(2000) NOT NULL COMMENT '消息内容',
  `touser` varchar(100) NOT NULL COMMENT '用户微信openid',
  `appid` varchar(50) NOT NULL,
  `store_sid` bigint(20) NOT NULL COMMENT '门店信息表的外键(storeinfo)',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `wx_result_code` varchar(20) DEFAULT NULL COMMENT '微信返回的编码  0 为正常，其他为不正常',
