/*Table structure for table `wx_vip_card` */

DROP TABLE IF EXISTS `wx_vip_card`;

CREATE TABLE `wx_vip_card` (
  `sid` bigint(20) NOT NULL AUTO_INCREMENT,
  `head_name` varchar(100) DEFAULT NULL COMMENT '标题内容',
  `head_picture_url` varchar(200) DEFAULT NULL COMMENT '头图片地址',
  `wx_head_picture_url` varchar(200) DEFAULT NULL COMMENT '微信头地址',
  `brand_code_status` varchar(10) DEFAULT NULL COMMENT '品牌会员卡状态（true, false）',
  `Online_code_status` varchar(10) DEFAULT NULL COMMENT '电子会员卡状态（true, false）',
  `create_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `store_code` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`sid`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

